import ESP3Packet from '../ESP3Packet'
import emptyPacket from '../EmptyPacketStructure.js'

export default class RadioERP2 extends ESP3Packet {
  constructor (esp3Packet = emptyPacket) {
    esp3Packet.header.packetType = 0x0a
    super(esp3Packet)
    this.packetTypeName = 'RADIO_ERP2'
    this.packetTypeNumber = 10
    this.subTelNum = this.optionalData[0]
    this.RSSI = this.optionalData[1]
    this.securityLevel = this.optionalData[2]
  }
}
